import { useState } from "react"


const Login = () => {

    let name = 'Loren'

    const change = (e) => {
      name = e.target.value
    }

    return (
        <div>
            <h1>Login</h1>
            <input type="text"  onChange={e=> change(e)} placeholder="Username" />

            <hr />
            <h1>{name}</h1>
        </div>
    )
}

export default Login
